import React, { useEffect, useState } from "react";
import { Col, Container, Image, Row } from "react-bootstrap";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faThumbsUp, faThumbsDown } from "@fortawesome/free-solid-svg-icons";

// Import the images
import img1 from '../images/postImage/images_postId1.jpg';
import img2 from '../images/postImage/images_postId2.jpg';
import img3 from '../images/postImage/images_postId3.jpg';
import img4 from '../images/postImage/images_postId4.jpg';
import img5 from '../images/postImage/images_postId5.jpg';
import img6 from '../images/postImage/images_postId6.jpg';
import img7 from '../images/postImage/images_postId7.jpg';
import img8 from '../images/postImage/images_postId8.jpg';
import img9 from '../images/postImage/images_postId9.jpg';
import img10 from '../images/postImage/images_postId10.jpg';

const HomePage = () => {
  const [post, setPost] = useState([]);
  const [activeTab, setActiveTab] = useState('Hot'); // Active tab state

  useEffect(() => {
    fetch(`http://localhost:9999/post`)
      .then((res) => res.json())
      .then((data) => {
        console.log("Post data: ", data)
        setPost(data);
      })
      .catch((error) => console.log(error));
  }, []);

  // Handle tab click
  const handleClick = (tab) => {
    setActiveTab(tab);
  };

  // Array of images
  const images = [img1, img2, img3, img4, img5, img6, img7, img8, img9, img10];

  return (
    <Container fluid>
      <Row className="d-flex mt-5">
        <Col md={2}></Col>
        <Col md={10}>
          <Row className="d-flex mt-5">
            {['Hot', 'New', 'Top'].map((tab, idx) => (
              <Col
                key={idx}
                md={1}
                className={`m-0 text-center ${activeTab === tab ? 'active-tab' : ''}`}
                style={{ cursor: 'pointer' }}
                onClick={() => handleClick(tab)}
                onMouseEnter={(e) => e.target.style.backgroundColor = 'gray'}
                onMouseLeave={(e) => e.target.style.backgroundColor = activeTab === tab ? 'gray' : 'transparent'}
              >
                <h3>{tab}</h3>
              </Col>
            ))}
          </Row>

          {post.map((item, index) => (
            <Row className="mt-2 mb-5" key={item.id}>
              <Col md={12}>
                <Row className="d-flex">
                  <Col md={2}>
                    {/* Use image from the array based on the post index */}
                    <Image src={images[index]} alt={`post-${index + 1}`} style={{ width: '100%', borderRadius: '10px' }} fluid />
                  </Col>
                  <Col md={10}>
                    <Row className="d-flex">
                      <Col md={2}>
                        <h5>{item.userId}</h5>
                      </Col>
                      <Col md={3}>
                        <p>One year ago</p>
                      </Col>
                    </Row>
                    <Row>
                      <Col md={12}>
                        <h3>{item.title}</h3>
                      </Col>
                    </Row>
                    <Row className="d-flex">
                      <Col md={1} className="d-flex">
                        <Row>
                          <Col md={2}>
                            <FontAwesomeIcon icon={faThumbsUp} />
                          </Col>
                          <Col md={2}>
                            <h5>{item.reactions.likes}</h5>
                          </Col>
                        </Row>
                      </Col>

                      <Col md={1}>
                        <Row>
                          <Col md={2}>
                            <FontAwesomeIcon icon={faThumbsDown} />
                          </Col>
                          <Col md={2}>
                            <h5>{item.reactions.dislikes}</h5>
                          </Col>
                        </Row>
                      </Col>

                      <Col md={2}>
                        <h5>{item.comment} Comment</h5>
                      </Col>

                      <Col md={1}>
                        <h5>Share</h5>
                      </Col>

                      <Col md={1}>
                        <h5>Save</h5>
                      </Col>

                      <Col md={1}>
                        <h5>Report</h5>
                      </Col>
                    </Row>
                  </Col>
                </Row>
              </Col>
            </Row>
          ))}
        </Col>
      </Row>
    </Container>
  );
};

export default HomePage;
